Colour.
In life (
Fig. 3A–D
), the entire dorsal surface of the head, body, forelimbs and hindlimbs is light brown; a darker brown inverse triangular marking bounded by a thin fold is present from the interorbital region to the posterior area of the head. The dorsal surface of the body, forelimbs and hindlimbs have indistinct, darker brown blotches. The dorsal surface of the lower arms, tibia and femur (hindlimbs) have dark brown transverse folds. The lateral side of the head, including the canthal area, is brown, darker around the nostrils and just posterior and below the canthus, lighter anterior and posterior to the eye, with dark markings above and below the skin bordering the eye; supratympanic fold light brown, with indistinct dark brown blotches. The entire ventral surface is light brown with a heavy dark transverse marking and dark blotches over the throat and on the chest and abdomen. Ventral surface of throat to chest is dark brown, while the abdomen, forelimbs and hindlimbs are light cream, with some small blotches. In preservative (
Fig. 4A–E
) aspects of the colour pattern remain, but the dorsum darkens.
